const routes = require('next-routes')();

routes
  .add('/9Fund/:address', '/9Fund/dashboard')
  .add('/9Fund/:address/requests', '/9Fund/requests/index')
  .add('/9Fund/:address/requests/new', '/9Fund/requests/new');

module.exports = routes;
